/********************************************************************
* FUNCTION u_o_ran_uplane_conf_tx_array_carriers_state_change_send
*
* Send a u_o_ran_uplane_conf_tx_array_carriers_state_change notification
* Called by your code when notification event occurs
*
********************************************************************/
void u_o_ran_uplane_conf_tx_array_carriers_state_change_send (
    dlq_hdr_t *v_tx_array_carriers)
{
    val_value_t *listval = NULL;
    val_value_t *parmval = NULL;
    status_t res = NO_ERR;
    uint32 dir = SAA_UPCONF_DIR_DL;
    uint32 number;
    uint32 ant;
    uint32 car;
    uint32 state_enum;
    uint32 notif_num = 0;
    xmlChar array_carrier[D_PARAM_NUM_MAX];
    xmlChar *state;

    /* パラメータは無視して別途データを取得する。(お行儀悪し) */
    (void)v_tx_array_carriers;
    T_MPSW_MSI_O_RAN_UPLANE_CONF_TX_STATE_CHANGE_NTF_IND *data =
        i_o_ran_uplane_conf_get_tx_notification_data();

    if (LOGINFO) {
        log_info("\nEnter %s", __func__);
    }

    if (!agt_notifications_enabled()) {
        log_debug2("\nSkipping <tx-array-carriers-state-change> notification; disabled");
        return;
    }
    
    if (LOGDEBUG) {
        log_debug("\nGenerating <tx-array-carriers-state-change> notification");
    }
    
    agt_not_msg_t *notif = agt_not_new_notification(tx_array_carriers_state_change_obj);
    if (notif == NULL) {
        log_error("\nError: malloc failed, cannot send "
        "<tx-array-carriers-state-change> notification");
        return;
    }
    
    /* add list tx_array_carriers to payload
     * replace following line with real code
     */
    //(void)v_tx_array_carriers;

    number = data->number;

    for (uint32 i = 0; i < number; i++){
        /* パラメータ取得 */
        ant = data->array_carrier_state_t[i].ant;
        car = data->array_carrier_state_t[i].car;
        state_enum = data->array_carrier_state_t[i].state;

    /* Sub 6でBeamforming ONの場合 */
	    if((saa_upconf_beamforming_mode == SAA_UPCONF_BF_ON) && (saa_upconf_unit_type == SAA_UPCONF_UNIT_TYPE_SUB6)) {
        /* Ant A, Ant Bの場合のnotification通知は読み捨てる */
        /* TxArray－Carrierが共通であり、同一TxArray－Carrierのnotificationを通知することを避けるため */
            if(ant == SAA_UPCONF_ANT_A || ant == SAA_UPCONF_ANT_B)
            {
                if (LOGINFO) {
                    log_info("\n%s:Throw away the notification. ant:%u, state:%u", __func__, ant, state_enum);
                }
                continue;
            }
	    }
		notif_num++;
        /* array_carrier取得 */
        res = i_o_ran_uplane_conf_get_array_carrier_from_ant_car(dir, ant, car, array_carrier);
        if(res != NO_ERR) {
            if(LOGWARN) {
                log_warn("\n%s: Failed i_o_ran_uplane_conf_get_array_carrier_from_ant_car (%s), Error=%d", __func__, y_o_ran_uplane_conf_N_tx_array_carriers, res);
            }
            agt_not_free_notification(notif);
            return;
        }

        /* state取得 */
        res = i_o_ran_uplane_conf_conv_state_enum_to_xmlchar(state_enum, &state);
        if(res != NO_ERR) {
            if(LOGWARN) {
                log_warn("\n%s: Failed i_o_ran_uplane_conf_conv_state_enum_to_xmlchar (%s), Error=%d", __func__, y_o_ran_uplane_conf_N_tx_array_carriers, res);
            }
            agt_not_free_notification(notif);
            return;
        }

        /* list */
        listval = agt_make_object(
            tx_array_carriers_state_change_obj,
            y_o_ran_uplane_conf_N_tx_array_carriers,
            &res);
        if(listval == NULL) {
            if(LOGWARN) {
                log_warn("\n%s: Failed to make list(%s), Error=%d", __func__, y_o_ran_uplane_conf_N_tx_array_carriers, res);
            }
            agt_not_free_notification(notif);
            return;
        }

        agt_not_add_to_payload(notif, listval);

        /* array_carrier設定 */
        parmval = agt_make_leaf2(
            VAL_OBJ(listval),
            y_o_ran_uplane_conf_M_o_ran_uplane_conf,
            y_o_ran_uplane_conf_N_name,
            array_carrier,
            &res);
        if(parmval == NULL) {
            if(LOGWARN) {
                log_warn("\n%s: Failed to make leaf(%s), Error=%d", __func__, array_carrier, res);
            }
            agt_not_free_notification(notif);
            return;
        }
        else {
            res = val_child_add(parmval, listval);
            if(res != NO_ERR) {
                val_free_value(parmval);
            }
        }

        /* state設定 */
        parmval = agt_make_leaf2(
            VAL_OBJ(listval),
            y_o_ran_uplane_conf_M_o_ran_uplane_conf,
            y_o_ran_uplane_conf_N_state,
            state,
            &res);
        if(parmval == NULL) {
            if(LOGWARN) {
                log_warn("\n%s: Failed to make leaf(%s), Error=%d", __func__, state, res);
            }
            agt_not_free_notification(notif);
            return;
        }
        else {
            res = val_child_add(parmval, listval);
            if(res != NO_ERR) {
                val_free_value(parmval);
            }
        }
    }

    if(notif_num>0) {
        sil_sa_queue_notification(notif);
        if (LOGINFO) {
            log_info("\n%s:Send the notification %s, %s", __func__, array_carrier, state);  /* pgr0000 */
        }
    }
    else{
        agt_not_free_notification(notif);
        if (LOGINFO) {
            log_info("\n%s:Throw away the notification.(notif_num=%d)", __func__, notif_num);
        }
    }

} /* u_o_ran_uplane_conf_tx_array_carriers_state_change_send */


